export const generateUnexistingDays = (day) => {
  const result = [];
  numberOfDays = 7 - day;
  for (let i = 0; i < numberOfDays; i++) {
    result.push(
      <div className='border border-white flex justify-center'>
        <div className='text-white py-1'>
          <p className='text-white'>N</p>
        </div>
      </div>
    );
  }
  return result;
};

export const generateUnavailableDays = (firstday, today) => {
  const result = [];
  numberOfDays = today - firstday;
  for (let i = firstday; i < numberOfDays; i++) {
    result.push(
      <div className='border border-gray-400 flex justify-center'>
        <div className='py-1'>
          <p className='text-gray-400'>{i}</p>
        </div>
      </div>
    );
  }
};

export const generateAvailableDays = (today, lastday) => {
  let result = [];
  for (let i = today; i <= lastDay; i++) {
    result.push(
      <div className='border border-gray-650 flex justify-center'>
        <div className='text-white py-1'>
          <p className='text-gray-650'>{i}</p>
        </div>
      </div>
    );
  }
  return result;
};
